      # end

      if api_results["Itineraries"] != [] || api_results["Legs"] != []
        raw_results << api_results
      end

      if api_results[:body] == "{\"ValidationErrors\":[{\"Message\":\"Rate limit has been exceeded: 20 PerMinute for PricingSession\"}]}"
        raw_results = fake_data
