            depart_segments_number: depart_segments_id.size - 1,
            return_date: trip["Legs"].find { |h| h['Id'] == return_flight_id }["Departure"],
            return_date_arrival: trip["Legs"].find { |h| h['Id'] == return_flight_id }["Arrival"],
